import { 
  composeBundles,
  createUrlBundle,
  createCacheBundle
} from 'redux-bundler';

import {
  createAuthBundle,
  createOlMapBundle,
  createOlBasemapBundle,
  createJwtApiBundle,
  createWebsocketApiBundle,
} from '@corpsmap/corpsmap-bundles';

import cache from '../utils/cache'

import routesBundle from './routes-bundle';

import drawBundle from './draw-bundle';
import nsiBundle from './nsi-bundle';

export default composeBundles(
  routesBundle,
  createUrlBundle(),
  createCacheBundle(cache.set),
  createAuthBundle({
    appId: '17de6a86-32a9-47fc-9fa5-e98a400111b3',
    redirectOnLogout: '/'
  }),
  createOlMapBundle(),
  createOlBasemapBundle(),
  createJwtApiBundle({
    root: 'https://x1s6pwmufa.execute-api.us-east-1.amazonaws.com/production'
  }),
  drawBundle//,
  // createWebsocketApiBundle({
  //   url: '//ec2-3-212-154-125.compute-1.amazonaws.com/nsiapi/'
  // }),
  // drawBundle,
  //nsiBundle
);
